#include <iostream>#include <algorithm>#include <vector>using namespace std;int main() {	int n;	cin >> n;	vector <pair<int, int>> v;	v.resize(n);	for (int i = 0; i < n; i++) {		scanf("%d %d", &v[i].first,&v[i].second);	}	sort(v.begin(), v.end());	for (int i = 0; i < n; i++) {		cout << v[i].first << " " << v[i].second << "\n";	}}